import React, { Component } from 'react';
import './css/estilos.css';
import Home from './components/pages/Home';
import {
  BrowserRouter as Router,
  Route,
  Link

} from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <Router>
        <Link to="/">inicio</Link>
        <Route path="/" component={Home} />
      </Router>
    );
  }
}

export default App;
